import React from 'react';
import DevelopingFutureStars from '../components/DevelopingFutureStars';
import WhatMakesUsSpecial from '../components/WhatMakesUsSpecial';
import HeroSection from '../components/HeroSection';
import MainObjective from '../components/MainObjective';

function Home() {
  return (
    <div className="home">
      {/* Hero Section */}
      <HeroSection />

{/* Main Objective Section */}
      <MainObjective />



      {/* Developing Stars Section */}  
      <DevelopingFutureStars />
      
      {/* What Makes Us Special Section */}
      <WhatMakesUsSpecial />

      {/* Center Location Section */}
      <section className="py-16 bg-custom-  misty-red">
        <div className="max-w-screen-xl mx-auto px-4 text-center">
          <h2 className="text-4xl font-bold">Our Center Location</h2>
          <p className="mt-4 text-lg text-gray-700">Conveniently located in the heart of the city, our daycare center is easily accessible to families.</p>
          <div className="mt-8">
            <img src={`${process.env.PUBLIC_URL}/Photos/location-map.png`} alt="Location Map" className="mx-auto rounded-lg shadow-lg" />
          </div>
        </div>
      </section>

      {/* Registration Section */}
      <section id="registration" className="py-16 bg-custom-blue text-white">
        <div className="max-w-screen-xl mx-auto px-4 text-center">
          <h2 className="text-4xl font-bold">Register Your Child</h2>
          <p className="mt-4 text-lg">
            Ready to join our daycare family? Weâ€™re excited to welcome your child to our community. Register today to secure your spot!
          </p>
          <a href="/registration" className="mt-6 inline-block bg-white text-custom-blue py-2 px-4 rounded hover:bg-gray-200 transition">Register Now</a>
        </div>
      </section>
    </div>
  );
}

export default Home;
